INSERT INTO `paragrafos` (`id`, `conteudo`, `imagem_id`, `propaganda_id`, `post_id`, `ordem`, `data_cadastro`) VALUES
(1, 'Um terremoto de magnitude 7,6 atingiu a costa oeste do México nesta segunda-feira (19) e danificou prédios, causou cortes de energia e fez com que moradores da Cidade do México tivessem que ir às ruas por segurança.\r\n', NULL, NULL, 1, 1, '2022-09-19'),
(2, 'O Sistema de Alerta de Tsunami dos EUA disse que há possibilidade de um tsunami perto da costa de Michoacán, no Oceano Pacífico, com risco de ondas de 1 a 3 metros de altura.\r\n', NULL, NULL, 1, 2, '2022-09-19'),
(3, 'A data é marcante para os mexicanos. Fortes terremotos sacudiram o país em 19 de setembro de 1985 e de 2017. Por isso, simulações são realizadas anualmente na data. O tremor foi registrado uma hora depois do fim das simulaçõe.\r\n', 1, NULL, 1, 3, '2022-09-19'),
(4, 'Em 2017, um tremor de magnitude 7,1 na região central do México matou 355 pessoas, o de 1985, que chegou a 8,1 na escala Richter, deixou 10.000 mortos.\r\n', 2, 1, 1, 4, '2022-09-19'),
(5, 'O tremor atingiu a costa oeste do país, na região de divisa dos estados de Michoacán e Colima, pouco depois das 13h no horário local (15h em Brasília). O terremoto foi a uma profundidade de cerca de 15 km. O registro foi feito pelo Serviço Geológico dos EUA. O serviço europeu marcou a mesma magnitude.\r\n', NULL, NULL, 1, 5, '2022-09-19'),
(6, 'O presidente Andrés Manuel López Obrador disse em um discurso em vídeo que uma pessoa morreu no porto de Manzanillo, no Pacífico, depois que um muro de uma loja caiu.\r\n', NULL, NULL, 1, 6, '2022-09-19'),
(7, 'A CBF sorteou nesta terça-feira a ordem dos mandos de campo das finais da Copa do Brasil, entre Flamengo e Corinthians, nos dias 12 e 19 de outubro. O Flamengo terá a vantagem de decidir o torneio em casa, no Maracanã. O campeão leva R$ 60 milhões nesta final, enquanto o vice fica com R$ 25 milhões. Os dois já acumularam R$ 16,8 milhões por terem avançado nas fases anteriores.\r\n', NULL, NULL, 2, 1, '2022-09-20'),
(8, 'Quem será o grande campeão da Copa do Brasil 2022? Corinthians ou Flamengo em duas partidas, a primeira acontecerá na Neo Química Arena, em São Paulo, enquanto a volta será no Estádio do Maracanã, no Rio de Janeiro.\r\n', 3, NULL, 2, 2, '2022-09-20'),
(9, 'O sorteio contou com a presença do técnico Dorival Júnior e do meia Diego Ribas pelo lado flamenguista. Pelo Corinthians, estiveram presentes o técnico Vítor Pereira e o goleiro Cássio.\r\n', NULL, NULL, 2, 3, '2022-09-20'),
(10, 'Os jogos da Final da Copa do Brasil serão transmitidos pela Globo, TV aberta, além dos canais SporTV, TV fechada, Premiere, pay-per-view e GloboPlay, serviço de streaming.\r\n', 4, 2, 2, 4, '2022-09-20'),
(11, 'Nesta edição, os dois rivais entraram só na terceira fase, assim como os outros times que disputaram a Copa Libertadores. O Timão passou por Portuguesa-RJ, Santos, Atlético-GO e Fluminense. Já o Rubro-Negro eliminou Altos-PI, Atlético-MG, Athletico-PR e São Paulo.Tanto Corinthians quanto Flamengo buscam o quarto título do torneio. O Timão venceu em 1995, 2002 e 2009, e o Rubro-Negro levantou a taça em 1991, 2006 e 2013.\r\n', NULL, NULL, 2, 5, '2022-09-20'),
(12, 'Os ingressos de ambas partidas ainda não foram disponibilizados, mas estimasse que começarão a serem comercializados duas ou uma semana antes do confronto.\r\n', 11, NULL, 2, 6, '2022-09-20'),
(13, 'A inédita final de Copa do Brasil também marcará a temporada em que Corinthians e Flamengo se encontrarão em mais duelos: seis. Três deles já ocorreram, com duas vitórias do Fla (ambas pelas quartas de final da Libertadores) e uma do Timão (pelo primeiro turno do Brasileiro). Além das duas finais, ainda haverá um jogo válido pela 35ª rodada do Brasileirão, no Maracanã.\r\n', NULL, NULL, 2, 7, '2022-09-20'),
(14, 'O São Paulo, entretanto, não jogou a Libertadores. Assim, disputa a Copa do Brasil 2022 desde a primeira fase. Para chegar até às semifinais, o time de Rogério Ceni passou por Campinense, Manaus, Juventude, Palmeiras e América-MG. \r\n', 6, 4, 2, 8, '2022-09-20'),
(15, 'A Agência Nacional de Vigilância Sanitária (Anvisa) aprovou nesta terça-feira (20) o primeiro produto para o diagnóstico da monkeypox no Brasil.\r\n', NULL, NULL, 3, 1, '2022-09-20'),
(16, 'A varíola dos macacos é transmitida pelo vírus monkeypox, que pertence ao gênero orthopoxvirus. É considerada uma zoonose viral (o vírus é transmitido aos seres humanos a partir de animais) com sintomas muito semelhantes aos observados em pacientes com varíola, embora seja clinicamente menos grave.\r\n', 12, NULL, 3, 2, '2022-09-20'),
(17, 'O teste registrado pela Anvisa é um produto fabricado pela Fundação Oswaldo Cruz chamado de \"Kit Molecular Multiplex OPV/MPXV/VZV/MOCV/RP\".\r\n', NULL, NULL, 3, 4, '2022-09-20'),
(18, 'A transmissão ocorre por contato próximo com lesões, fluidos corporais, gotículas respiratórias e materiais contaminados, como roupas de cama. E, segundo o órgão de saúde, a transmissão de humano para humano está ocorrendo entre pessoas com contato físico próximo com casos sintomáticos.\r\n', 9, NULL, 3, 5, '2022-09-20'),
(19, 'Segundo a Fiocruz, o teste é indicado para o diagnóstico clínico diferencial de infecções com sintomatologias semelhantes à infecção pelo vírus da monkeypox, a varíola dos macacos.\r\n', NULL, NULL, 3, 6, '2022-09-20'),
(20, 'O contato próximo com pessoas infectadas ou materiais contaminados deve ser evitado. Luvas e outras roupas e equipamentos de proteção individual devem ser usados ​​ao cuidar dos doentes, seja em uma unidade de saúde ou em casa\r\n', 8, 5, 3, 7, '2022-09-20'),
(21, 'Ainda segundo a agência, a disponibilidade desse kit que teve o registro aprovado no Brasil depende da empresa detentora do registro. A avaliação do pedido de registro pela Anvisa levou 39 dias, incluindo 17 dias utilizados pela empresa solicitante para atender exigências técnicas, informou a Anvisa.\r\n', NULL, NULL, 3, 8, '2022-09-20');

